import React, { Fragment, useState } from 'react';
import "./css/navbar.css"
import { Link, Navigate } from "react-router-dom"
import { connect } from 'react-redux';
import { logout } from '../actions/auth';

const Navbar = ({ logout, isAuthenticated }) => {
   
    const [redirect, setRedirect] = useState(false);

    const logout_user = () => {
        logout();
        setRedirect(true);
    };

    const guestLinks = () => (
        <Fragment>
            <li className='nav-item'>
                <Link className='nav-link' to='/login'>Login</Link>
            </li>
            <li className='nav-item'>
                <Link className='nav-link' to='/signup'>Sign Up</Link>
            </li>
        </Fragment>
    );

    const authLinks = () => (
        <Fragment>
            <li className='nav-item'>
                <div className="nav-dropdown">
                    <button className="nav-button">Projects</button>
                    <div className="dropdown-content">
                        <Link to="/projects">Project 1</Link>
                        <Link to="/projects">Project 2</Link>
                        <Link to="/projects">Project 3</Link>
                    </div>
                </div>
            </li>
            <li className='nav-item'>
                <div className="nav-dropdown">
                    <button className="nav-button">Your Work</button>
                    <div className="dropdown-content">
                        <Link to="/work">Work 1</Link>
                        <Link to="/work">Work 2</Link>
                        <Link to="/work">Work 3</Link>
                    </div>
                </div>
            </li>
            <li className='nav-item'>
                <div className="nav-dropdown">
                    <button className="nav-button">Filters</button>
                    <div className="dropdown-content">
                        <Link to="/filters">Filter 1</Link>
                        <Link to="/filters">Filter 2</Link>
                        <Link to="/filters">Filter 3</Link>
                    </div>
                </div>
            </li>
            <li className='nav-item'>
                <div className="nav-dropdown">
                    <button className="nav-button">Teams</button>
                    <div className="dropdown-content">
                        <Link to="/teams">Team 1</Link>
                        <Link to="/teams">Team 2</Link>
                        <Link to="/teams">Team 3</Link>
                    </div>
                </div>
            </li>
            <li className='nav-item'>
                <a className='nav-link' href='#!' onClick={logout_user}>Logout</a>
            </li>
        </Fragment>
    );

    return (
        <Fragment>
            <nav className="nav-container">
                <ul className="nav-list">
                    <h3>Salty</h3>
                    {isAuthenticated ? authLinks() : guestLinks()}
                </ul>
                {redirect ? <Navigate to="/" /> : null}
            </nav>
        </Fragment>
    );
}

const mapStateToProps = state => ({
    isAuthenticated: state.auth.isAuthenticated
});

export default connect(mapStateToProps, { logout })(Navbar);
